import React from 'react'
import ProgressTaskContainer from './ProgressTaskContainer.js'
import CreatedTaskContainer from './CreatedTaskContainer.js'


class ProfilePage extends React.Component {

    taskButtonDisplay(task) {
        const currentStatus = task.status

        switch (currentStatus) {
            case 1: 
                return(<button>status was 1</button>)

            case 2: 
                return(<button>status was 2</button>)

            case 3:
                return(<button>status was 3</button>)

            default:
                return(<button>we need to fix this</button>)
        }
    }

    render() {

        return (
            <>

            <h1>Lending a Hand</h1>
            <ProgressTaskContainer tasks = {this.props.tasks} currentUser ={this.props.currentUser} taskButtonDisplay />
            <h1>Asking for Help</h1>
            <CreatedTaskContainer tasks = {this.props.tasks} currentUser ={this.props.currentUser}/>
            </>

        )
    }

}

export default ProfilePage;
